import React from "react";
import { withRouter } from "react-router-dom";

//UI
import {Dialog,DialogActions,DialogTitle,Button,Tooltip,Typography,AppBar,IconButton,
  CircularProgress,Avatar,ListItemText,ListItem,Drawer,Divider,Collapse,Paper} from '@material-ui/core';
// import Alert from '@material-ui/lab/Alert';
// import {Close,Share,FileCopyOutlined, Refresh} from '@material-ui/icons';\
import { withStyles } from "@material-ui/core/styles";
import { styles } from "./UIComponents"
class Input extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        productList : ["Airpod"]
    };
  }

  render() {
    const {productList} = this.state
    const {classes} = this.props
    return(
        <div className = {classes.root}>
            <AppBar className = {classes.appBar} style = {{backgroundColor : "#333333"}}>
                <Typography>Purchase History</Typography>
            </AppBar>
            <div>
                {productList.map((p,i) => (
                    <div>
                        <Paper></Paper><Typography>{p}</Typography>
                        <Typography>{p}</Typography>
                        <Typography>{p}</Typography>
                    </div>
                ))}
            </div>
        </div> 
    )
  }
}
export default withStyles(styles)(Input);
